@XpengGuru Aj då! Det är mycket som krashar just nu. Titta bara på powercell. 
Men va fan!! Xpeng är bra företag ! #stillfront är också bra ! Men ibland så faller kurserna ! 
Bara hålla I

@SunFlowerTuna @pontusflexman Hur resonerar du kring det? 
Jag kollade snabbt på Stillfront:s siffror, ser inte undervärderingen.

Nokia var undervärderad tyckte jag, fick nästan 20% på en vecka. Traton, Serneke och ABN Amro är undervärderade enl. mig. Men hur är Stillfront undervärderad?
